import logo from "./logo.svg";
import "./App.css";
import FormImport from "./view/FormImport";
function App() {
  return (
    <>
      <div className="App">
        <img src={logo} className="App-logo" alt="logo" />
      </div>
      <BrowserRouter>
        <Switch>
          <Route path="/Contact">
            <Contact />
          </Route>

          <Route path="/Login">
            <Login />
          </Route>

          <Route path="/Register">
            <Register />
          </Route>
        </Switch>
      </BrowserRouter>
    </>
  );
}

export default App;
